--------------------------------------------------------
--  DDL for View HV_EVERX_N_DIMS
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "RIGEL"."HV_EVERX_N_DIMS" ("WEEK_OF_YEAR", "MONTH_LONG", "MONTH_LONG_DESC", "QUARTER_ID", "HALF_OF_YEAR_ID", "BOOKED_YEAR_MM", "YEAR_ID", "ORG_ID", "TXN_DT", "ACCOUNT_ID", "BOOKED_DATE", "MONTHS", "YEARS", "MOB_COUNT", "DISB_COUNT", "APPLICATION_NO", "SCHEME_CODE", "AMOUNT_APPROVED", "PRODUCT_CODE", "PRODUCT_DESC1", "PRORGAM", "PROMOTION", "ACTIVE", "SOURCE_OFFICE_ID", "GEO_ID", "BUSINESS_LINE", "BUSINESS_SUBLINE", "FACILITY", "PRODUCT", "AGE_BRACKET", "NET_INCOME_BRACKET", "AGENCY_NAME1", "AGENCY_TYPE_DESC1", "CIBIL_SCORE", "LTV_DESC1", "DBR_DESC1", "RM_NAME", "PROPERTY_TPE") AS 
  SELECT TIME1.WEEK_OF_YEAR,
    TIME1.MONTH_LONG,
    TIME1.MONTH_LONG_DESC,
    TIME1.QUARTER_ID,
    TIME1.HALF_OF_YEAR_ID,
    TO_CHAR(TIME1.DAY_ID,'YYYY') ||'-'|| TO_CHAR(TIME1.DAY_ID,'MM') BOOKED_YEAR_MM,
    TIME1.YEAR_ID,
    HAS.ORG_ID,
    HAS.TXN_DT TXN_DT,
   MOB.ACCOUNT_ID,
MOB.BOOKED_DATE,
MOB.MONTHS,
MOB.YEARS,
MOB_COUNT,
MOB.DISB_COUNT,
    HAS.APPLICATION_NO,
   -- HAS.ACCOUNT_ID,
    HAF.SCHEME_CODE,
    HAF.AMOUNT_APPROVED,
    HAF.PRODUCT_CODE,
    HAF.PRODUCT_DESC1,
    HAF.FF_VC4 PRORGAM,
    HAF.FF_VC5 PROMOTION,
    HAS.ACTIVE,
    --HAS.ACTIVATION_DT,
    --HAS.DEACTIVATION_DT,
    HAD.SOURCE_OFFICE_ID,
    BRANCH.GEO_ID,
    HOD.HOD_PRODUCT_DESC1 BUSINESS_LINE,
    HOD.HOD_SUBPRODUCT_DESC1 BUSINESS_SUBLINE,
    HOD.HOD_FACILITY_DESC1 FACILITY,
    HOD.HOD_SCHEME_DESC1 PRODUCT,
    HD.AGE_BRACKET_DESC1 AGE_BRACKET,
    HD.INCOME_BRACKET_DESC1 NET_INCOME_BRACKET,
    --AGENCY.AGENCY_CODE,
    AGENCY.AGENCY_NAME1,
    AGENCY. AGENCY_TYPE_DESC1,
     HD.SCORECARD_DESC1 CIBIL_SCORE,
     HD.LTV_DESC1,
     HD.DBR_DESC1,
 HAC. EMPLOYEE_NAME1 RM_NAME, 
    HAF.FF_VC1 PROPERTY_TPE
  FROM HI_APPLICATION_FACILITIES HAF,
    TIME_CAL_DIM TIME1,
    HI_APPLICATION_DEMOGRAPHICS HAD,
    HI_ACCOUNT_SNAPSHOT HAS,
    UM_GEOGRAPHY BRANCH,
    HV_MOB_SIX_MONTHS MOB,
    HI_APPLICATION_AGENCY HAC,
    UM_AGENCY AGENCY,
    HDM_OFFERING_DIM HOD,
    HDM_CUSTOMER HD
  WHERE BRANCH.GEO_CODE  = TO_CHAR(HAD.SOURCE_OFFICE_ID)
  AND HAS.APPLICATION_NO = HAC.APPLICATION_NO
  AND HAF.APPLICATION_NO = HAD.APPLICATION_NO
  AND TIME1.DAY_ID (+)   = MOB.BOOKED_DATE
  AND TIME1.ORG_ID    = HAS.ORG_ID
  AND AGENCY.AGENCY_CODE = HAC.AGENCY_CODE
 -- AND HD.UID_NO (+)      = HAS.ACCOUNT_ID
   AND HAS.APPLICATION_NO = HD.UID_NO
  AND HAF.ORG_ID         =777
  AND HAF.ACCOUNT_ID    = HAS.ACCOUNT_ID
  AND HAF.PRODUCT_CODE   = HOD.HOD_SCHEME_CODE
  AND HAS.ACCOUNT_ID     = HAF.ACCOUNT_ID
  AND MOB.ACCOUNT_ID     = HAF.ACCOUNT_ID
  AND MOB.ACCOUNT_ID     = HAS.ACCOUNT_ID
  AND HAS.ORG_ID         =HAF.ORG_ID
 AND HOD.HOD_PRODUCT_DESC1 = 'ORGANIC';
REM INSERTING into RIGEL.HV_EVERX_N_DIMS
SET DEFINE OFF;
